import React from "react";
import { Button, FlatList, TextInput, View } from "react-native";
 
class Search extends React.Component {
  constructor(props){
    super(props)

    this.state = {
      username: '',
      password: '',
    }
  }
 
  render(){
    <View>
      <TextInput
        style={styles.textinput} 
        placeholder="Code postal"
      />

      <Button title="Rechercher" onPress={postPostalCodeSearch} />
      <FlatList  />
    </View>
  }
}

const styles = StyleSheet.create({
  textinput: {
    marginLeft: 5,
    marginRight: 5,
    height: 50,
    borderColor: '#000000',
    borderWidth: 1,
    paddingLeft: 5,
  },
})

export default Search
